import React from 'react';
import {Card, CardContent, Grid, CardMedia, Typography, Button} from "@material-ui/core";
import {green} from "@material-ui/core/colors";
import { withRouter } from 'react-router-dom';

const CreateFacultyCard = props => {
  return (
      <Card elevation={4} style={{
        borderRadius: "16px",
        background:
          `linear-gradient(34deg, ${green[900]} 0%, ${green[500]} 29%, ${green[800]} 92%)`
      }}>
        <CardContent>
          <Grid container justify={"center"}>
            <Grid item xs={8} style={{
              display: "flex",
              flexDirection: "column",
              justifyContent: "space-around",
              alignItems: "left"
            }}>
              <Typography variant={"body2"} style={{
                fontWeight: 500,
                color: "white"
              }}>
                BACHELOR OF TECHNOLOGY
              </Typography>
              <Typography variant={"h5"} style={{
                fontWeight: 300,
                color: "white"
              }}>
                Add Faculty
              </Typography>
              <Grid container spacing={1}>
                <Grid item xs={5}>
                  <Button
                    variant={"contained"}
                    style={{
                      backgroundColor: 'rgba(255, 255, 255, 0.15)',
                      color: "white",
                      borderRadius: "16px",
                    }}
                    onClick={() => props.history.push("/dashboard/faculty/add")}
                    fullWidth
                  >
                    Add +
                  </Button>
                </Grid>
              </Grid>
              <Grid item xs={5}>
                <Button
                  variant={"contained"}
                  style={{
                    backgroundColor: 'rgba(255, 255, 255, 0.15)',
                    color: "white",
                    borderRadius: "16px",
                  }}
                  onClick={() => props.history.push("/dashboard/faculty/list")}
                  fullWidth
                >
                  List
                </Button>
              </Grid>
            </Grid>
            <Grid item xs={4}>
              <CardMedia style={{
                height: "120px",
                width: "120px",
                marginLeft: "auto",
                marginRight: "auto"
              }} image={require("../../../assets/professor.png")} />
            </Grid>
          </Grid>
        </CardContent>
      </Card>
    );
};

export default withRouter(CreateFacultyCard);
